export interface Common {
    /** 应用标识 */
    bid: string;
    /** 页面标识 */
    pid: string;
    /** 页面访问标识，用于区别同一个 pid 的多次访问 */
    view_id: string;
    /** 用户标识，由接入方设定 */
    user_id: string;
    /** 用户标识 加密id ttwid */
    ttwid?: string;
    /** 用户操作id */
    action_id?: string;
    /** 设备标识，保存在本地存储 */
    device_id: string;
    /** 实例会话标识 */
    session_id: string;
    /** 自定义维度 */
    context: {
        [key: string]: string;
    };
    /** 代码部署版本 */
    release: string;
    /** 代码部署环境 */
    env: string;
    /** 环境 */
    url: string;
    /** 动态变化，需要监听 */
    network_type: string;
    /** 客户端时间戳，发生时间 */
    timestamp: number;
    /** 上报 SDK 版本 */
    sdk_version: string;
    /** 上报 SDK 名称, 以区分第三方 SDK */
    sdk_name: string;
    /** 当前事件命中的有效采样率 */
    sample_rate: number;
    /** 小程序专用, 当前小程序宿主类型 */
    sdk_host?: string;
    /** 客户端时间偏移量, 协助服务端进行时间校准 */
    sdk_offset: number;
}
